data.text:
@Light_Keepxr &gt;&gt; podría haberme marchado y tú podrías no haber sido una puta suicida. 

—Masculla las palabras con cierto desprecio.—

¿¡Te crees que voy a dejar que te mates delante de mí porque has pillado un berrinche, niñata!? 

—Gira la cabeza, queriendo evitar el contacto visual &gt;&gt;

tweets.text:
@Light_Keepxr &gt;&gt; amanezca con un moratón de tamaño considerable en la zona.

Incluso él valora su vida en cierto modo, por lo que al escuchar la respuesta tan despreocupada de la mujer, cierra la mano restante en forma de puño inconscientemente, apretando esta con algo de fuerza.—

Ya, &gt;&gt;
